import axios from "axios"

export async function getUser(access_token) {
  const response = axios.get(`https://www.googleapis.com/oauth2/v1/userinfo?access_token=${user.access_token}`)
}

export async function getIp() {
  const ip = await fetch('https://ipapi.co/json/');
  const response = await ip.json();
  return response;
} 

export async function getJoke() {
  const joke = await fetch('https://official-joke-api.appspot.com/random_joke');
  return joke.json();
}
